import React, {useState} from 'react';
import axios from "axios";

const App = () => {
  const [data, setData] = useState(null);
  const onClick = async() =>{
    try{
    const response = await axios.get
    ('http://newsapi.org/v2/top-headlines?country=kr&apiKey=fd5ac7f03f9a4a679f21aa2932a9ffb0').then(response=>
    setData(response.data))


    } catch(e){
      console.log(e);
    }
    console.log(data);
  }


  return (
    <div>
      <div>
        <button onClick={onClick}>불러오기</button>
      </div>
      {data && <textarea rows={70} value={JSON.stringify(data, null, 2)} readOnly={true} />}
    </div>
  )

}
export default App;
